import React, { Component } from 'react';
import { Container } from 'react-bootstrap/lib/Tab';
import { Row } from 'react-bootstrap';
import { Col } from 'react-bootstrap';

export default class Menu extends Component {
	render() {
		return (
			<div>
				<Container>
					<Row>
						<Col>
							<p>Hello</p>
						</Col>
					</Row>
				</Container>
			</div>
		);
	}
}
